def solve(a, b):
    a.sort()
    b.sort()
    d = sum(a) - sum(b)
    if d % 2 != 0:
        return -1
    for x in a:
        for y in b:
            if x - y == d/2:
                return " ".join(map(str,[x, y]))
            if x - y <  d/2:
                break
    return -1

